How to replace specific fields in mongodb but return the rest<p>I am not sure the best way to design this.  I have a collection where I want to reinsert into a new collection but I want to keep the structure exactly the same minus a few fields.</p>
<pre><code>{
_id: &quot;123&quot;,
date: &quot;1900-01-01T11:00:00.0000000&quot;,
name: &quot;joe&quot;,
birthday: &quot;1999-01-01&quot;
}
</code></pre>
<p>This could contain other fields that I do not know about - but I know for a fact I want to convert all dates to be ISO Date type - so I only want to be specific to only 4-5 fields out of the possible 20+ fields.</p>
<p>Example of final:</p>
<pre><code>{
_id: &quot;123&quot;,
date: ISO_Date(&quot;1900-01-01T11:00:00.0000000&quot;),
name: &quot;joe&quot;,
birthday: ISO_Date(&quot;1999-01-01T11:00:00.0000000&quot;)
}
</code></pre>
<p>I was thinking I can create a few new fields with the add option like so:</p>
<pre><code>db.collection.aggregate([
//add
{
    $addFields: {
       convertDate: ISO_date(date) ,
       convertBirthdate: ISO_date(date)
     }
},
//
{
    //stuck here
    //select all
    //replace the date strings with the new 
 $project : 
    { 
      //select * but avoid writing each field out as I could miss a few
      *, 
      //replace date with addfields
      date : $convertDate,  
      //replace birthday
      birthday: $convertBirthdate
    } 
}
])
</code></pre>
<p>Please let me know if this is possible or another more efficient way to do it.</p>

